[General]
cmdenv-express-mode = true
cmdenv-autoflush = true
cmdenv-status-frequency = 1s
**.cmdenv-log-level = info

image-path = ../../images

network = org.car2x.veins.modules.application.Thesis_src.scenarios.ObserverScenarioLuST

###############################s###########################
#            Simulation parameters                       #
##########################################################
debug-on-errors = true
print-undisposed = true

**.scalar-recording = true
**.vector-recording = true
*.param-record-as-scalar = true
#*.playgroundSizeX = 13613.76m
#*.playgroundSizeY = 11455.04m
*.playgroundSizeX = 14000m
*.playgroundSizeY = 12000m
*.playgroundSizeZ = 50m


##########################################################
# Annotation parameters                                  #
##########################################################
*.annotations.draw = false

##########################################################
#            WorldUtility parameters                     #
##########################################################
*.world.useTorus = false
*.world.use2D = false


##########################################################
# Obstacle parameters                                    #
##########################################################
*.obstacles.obstacles = xmldoc("config.xml", "//AnalogueModel[@type='SimpleObstacleShadowing']/obstacles")
##########################################################
#            TraCIScenarioManager parameters             #
##########################################################
*.manager.updateInterval = 1s
*.manager.host = "localhost"
*.manager.port = 9999
*.manager.autoShutdown = true
*.manager.moduleName = "node"
*.manager.moduleDisplayString = ""
*.manager.margin = 25
*.manager.launchConfig = xmldoc("lust.launchd.xml")

##########################################################
#                      Tracker SETTINGS                  #
#                                                        #
#                                                        #
##########################################################

*.tracker.trackInterval = 1s 	#should be >= maximum beacon interval over all vehicles 
*.tracker.matlabfileformat = false
*.tracker.exportBeacons = false
*.tracker.waitBfrDelete = 2s 
*.tracker.maxSilence = 0s
*.tracker.*.param-record-as-scalar = true

