*.MxZ[*].applType = "mixZoneRSU"
*.MxZ[*].appl.debug = false
*.MxZ[*].mobility.z = 1.895
*.MxZ[*].appl.headerLength = 256 bit         
*.MxZ[*].appl.dataLength = 100 byte
*.MxZ[*].appl.advertiseInterval = 3s


##########################################################
#            11p specific parameters                     #
#                                                        #
#                    NIC-Settings                        #
##########################################################
*.connectionManager.pMax = 20mW
*.connectionManager.sat = -89dBm
*.connectionManager.alpha = 2.0
*.connectionManager.carrierFrequency = 5.890e9 Hz
*.connectionManager.sendDirect = true

*.**.nic.mac1609_4.useServiceChannel = false

*.**.nic.mac1609_4.txPower = 20mW
*.**.nic.mac1609_4.bitrate = 18Mbps

*.**.nic.phy80211p.sensitivity = -89dBm
*.**.nic.phy80211p.useThermalNoise = true
*.**.nic.phy80211p.thermalNoise = -110dBm
*.**.nic.phy80211p.decider = xmldoc("config.xml")
*.**.nic.phy80211p.analogueModels = xmldoc("config.xml")
*.**.nic.phy80211p.usePropagationDelay = true


*.connectionManager.maxInterfDist = 300m
*.connectionManager.drawMaxIntfDist = true


*.**.nic.phy80211p.minPowerLevel = -110dBm

*.**.nic.phy80211p.useNoiseFloor = true
*.**.nic.phy80211p.noiseFloor = -200dBm

*.**.nic.phy80211p.antenna = xmldoc("antenna.xml", "/root/Antenna[@id='monopole']")
*.node[*].nic.phy80211p.antennaOffsetY = 0 m
*.node[*].nic.phy80211p.antennaOffsetZ = 1.895 m
#*.**.nic.mac1609_4.maxQueueSize = 100

##########################################################
#            Batch Runs and parameters SETTINGS          #
#                                                        #
#                                                        #
##########################################################
repeat = 1
seed-set = ${repetition}
sim-time-limit = 61200s


##########################################################
#                      App Layer                         #
##########################################################
*.node[*].applType = "PrivateVehicleApp"
*.node[*].appl.headerLength = 256 bit
*.node[*].appl.sendBeacons = true
*.node[*].appl.dataOnSch = false
*.node[*].appl.beaconInterval = 1s
# schemeFlag = 0: Baseline
# schemeFlag = 1: IPD or RIPD
*.node[*].appl.schemeFlag = 1
*.node[*].appl.beaconInterval.param-record-as-scalar = true
*.node[*].appl.dataLength = 80 byte

##########################################################
#                      Mobility                          #
##########################################################
*.node[*].veinsmobility.x = 0
*.node[*].veinsmobility.y = 0
*.node[*].veinsmobility.z = 2
*.node[*].veinsmobility.setHostSpeed = true
*.node[*].mobilityType = "TraCIMobility"
*.node[*].mobilityType.debug = false
*.node[*].veinsmobilityType.debug = false
*.node[*].veinsmobility.accidentCount = 0


[Config PeriodicalPsynmChange]
# Periodical pseudonym change every 10 second (fixed) 
*.node[*].applType = "VehiclePeriodicalPC"
*.node[*].appl.initPsynmLifetime = intuniform(60s, 90s) 
*.node[*].appl.minPsynmLifetime = 60s
*.node[*].appl.maxPsynmLifetime = 60s


